static POSTION Pos = {480, 150, 6, 2};

FlagStatus Flag = RESET;

void Sprite_Run(void const * argument)
{
	MySprite[0].hSprite = GUI_SPRITE_Create(MySprite[0].apImages[0], 480, 150);
	MySprite[1].hSprite = GUI_SPRITE_Create(MySprite[1].apImages[0], 480, 150);
	while(1)
	{
		MySprite[Flag].Index ++;
		if(MySprite[Flag].Index >= MySprite[Flag].NumImages)
			MySprite[Flag].Index = 0;
		if(!Flag)
			Pos.xPos -= Pos.dx;
		else
			Pos.xPos += Pos.dx;
		Pos.yPos += Pos.dy;
		if((Pos.yPos <= 0) || (Pos.yPos >= 209))
			Pos.dy = -Pos.dy;
		GUI_SPRITE_SetBitmapAndPosition(MySprite[Flag].hSprite, MySprite[Flag].apImages[MySprite[Flag].Index], Pos.xPos, Pos.yPos);
		if((Pos.xPos > 480) || (Pos.xPos < -40))
			Flag = ((Flag)? RESET : SET);
		GUI_Delay(100);
	}
}

